import './index.scss';

function App() {
  return (
    <div class="container">
      <header class="header">
        <div class="main-ico">
          <img src="/img/main-ico.png" alt="" />
          <h1>React-store</h1>
        </div>

        <div class="icons">
          <img src="/img/like.png" alt="" />
          <img src="/img/pack.png" alt="" />
          <img src="/img/bought.png" alt="" />
        </div>
      </header>
      <section class="content">
        <p>Это секция контента.</p>
      </section>
    </div>
  );
}

export default App;
